Console.WriteLine(s.PossibleStringCount("", 1971));

public class Solution
{
    public int PossibleStringCount(string word, int k)
    {

        int mod = 1_000_000_007;
        List<int> RunLengths = new List<int>();
        char prev = word[0];
        int count = 1;

        long totalPerms = 1;
        for (int i = 1; i < word.Length; i++)
        {
            if (prev == word[i])
            {
                count++;
            }
            else
            {
                prev = word[i];
                RunLengths.Add(count);
                totalPerms = (totalPerms * count)%mod;
                count = 1;
            }
        }
        RunLengths.Add(count);
        totalPerms = (totalPerms * count)%mod;


        int n = RunLengths.Count;
        int[,] dp = new int[n + 1, k];
        int[,] prefixSums = new int[n + 2, k + 1];

        for (int j=0; j < k; j++)
        {
            dp[n,j] = 1;
            prefixSums[n,j +1] = (prefixSums[n,j] + dp[n,j]) % mod; 
        }
        

        for (int i = n - 1; i >= 0; i--)
        {
            for(int j = k -1 ; j >= 0; j--)
            {

                int l = j + 1;
                int r = j + RunLengths[i];
                if (r >= k) r = k - 1;

                if (l <= r)
                {
                    dp[i, j] = (prefixSums[i + 1, r + 1] - prefixSums[i + 1, l] + mod) % mod;
                }
               
            }
            for (int j = 0; j < k; j++)
            {
                prefixSums[i, j + 1] = (prefixSums[i, j] + dp[i, j]) % mod;
            }
        }
        

        int invalid = dp[0, 0];
        
        return (int)((totalPerms - invalid + mod) % mod);

        
    }
}